.game-window {
  max-width: 90%;
  max-height: 700px;
  margin: 0 auto;
  display: grid;
  grid-template-columns: repeat(18, 1fr);
  grid-template-rows: repeat(12, 1fr);
}
.game-window .runeboard {
  background-color: #2b1f12;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
}
.game-window .runeboard img {
  max-height: 95%;
}
.game-window #ulf-board {
  background-color: lightblue;
}
.game-window #sigrid-board {
  background-color: lightblue;
}
.game-window #message-board {
  grid-column: 4/span 13;
  grid-row: 1/span 1;
}
.game-window #pot {
  grid-column: 5/span 10;
  grid-row: 3/span 4;
}
.game-window #ulf-runeboard {
  grid-column: 1/span 8;
  grid-row: 8/span 2;
}
.game-window #sigrid-runeboard {
  grid-column: 11/span 8;
  grid-row: 8/span 2;
}
.game-window .buttonboard #ulf-buttonboard #ulf-button-draw {
  grid-column: 7/span 2;
  grid-row: 10/span 1;
  background-color: red;
}
.game-window .buttonboard #ulf-buttonboard #ulf-button-bell {
  grid-column: 5/span 2;
  grid-row: 10/span 1;
}
.game-window .buttonboard #ulf-buttonboard #ulf-button-decline {
  grid-column: 3/span 2;
  grid-row: 10/span 1;
}
.game-window #ulf-board {
  grid-column: 1/span 9;
  grid-row: 11/span 2;
}
.game-window #sigrid-board {
  grid-column: 10/span 9;
  grid-row: 11/span 2;
}

@media (max-width: 1000px) {
  body {
    background-color: red;
  }
}
